DROP TABLE IF EXISTS covid ;

CREATE TABLE covid (
    country_code VARCHAR(26),
    report_date DATE,
    tests NUMERIC(15,0),
    confirmed NUMERIC(15,0),
    recovered NUMERIC(15,0),
    deaths NUMERIC(15,0),
    hosp NUMERIC(15,0),
    vent NUMERIC(10,0),
    cancel_events NUMERIC(5,0),
    icu NUMERIC(5,0),
    school_closing NUMERIC(5,0),
    workplace_closing NUMERIC(5,0),
    gatherings_restrictions NUMERIC(5,0),
    transport_closing NUMERIC(5,0),
    stay_home_restrictions NUMERIC(5,0),
    internal_movement_restrictions NUMERIC(5,0),
    international_movement_restrictions NUMERIC(5,0),
    information_campaigns NUMERIC(5,0),
    testing_policy NUMERIC(5,0),
    contact_tracing NUMERIC(5,0),
    stringency_index NUMERIC(15, 3));


ALTER TABLE covid ADD PRIMARY KEY (country_code, report_date) ;

ALTER TABLE covid ADD CONSTRAINT fk_covid_countries
    FOREIGN KEY (country_code) REFERENCES country_gen_info (country_code) ;



